package no.entur.abt.android.token.keystore;

public class TokenKeystoreException extends Exception {

	public TokenKeystoreException() {
	}

	public TokenKeystoreException(String message) {
		super(message);
	}

	public TokenKeystoreException(String message, Throwable cause) {
		super(message, cause);
	}

	public TokenKeystoreException(Throwable cause) {
		super(cause);
	}
}
